import { Button, TextField } from '@mui/material';
import { Container } from '@mui/material'
import { Redirect } from 'react-router-dom'
import React, { Component } from 'react';

export default class form extends Component {

  constructor(props){
      super(props);
      this.state = {
          email: false,
          password: false,
      }

  }

    render() {
        const { email, password } = this.state;
        return (

            <div>
                <Container component={'article'} max-width="small">
                    <h1>Loguin</h1>
                    <TextField label="email" value={email} margin="normal" fullWidth />
                    <TextField label="Passoword" value={password} margin="normal" fullWidth />
                    <Button type="submit"
                        variant="contained"
                        onClick={() => {
                            if( email === 'Pedro.goulart09@icloud.com' && password === 1234) {
                              this.setState({ email: true, password: true})
                            }

                        }}
                    >Sign-in</Button>




                </Container>
            </div>
        )
    }
}
